INSERT INTO `config_info` VALUES (115, 'escription', 'PERSISTENCE_GROUP', '  [\n    {\n      \"resource\": \"oauthToken\",\n      \"limitApp\": \"default\",\n      \"grade\": \"1\",\n      \"count\": \"1\",\n      \"strategy\": \"0\",\n      \"controlBehavior\": \"0\",\n      \"clusterMode\": false\n    }\n  ]\n\n// resource：资源名，即限流规则的作用对象\n// limitApp：流控针对的调用来源，若为 default 则不区分调用来源\n// grade：限流阈值类型（QPS 或并发线程数）\n// count：限流阈值\n// strategy：调用关系限流策略\n// controlBehavior：流量控制效果（直接拒绝、Warm Up、匀速排队）\n// clusterMode：是否集群\n', '4ba5fa7fd268b6e47655ef211a20eee9', '2021-01-20 05:44:45', '2021-01-20 06:19:39', NULL, '58.212.133.156', '', 'sentinelPersistence', '', '', '', 'json', '');

